INSERT INTO `DP_Objectives` VALUES (1,'DP-0008-01-001','DP-0008-OBJ-01','DP-0008-01','To increase legal literacy and awareness for the women, youth and formation of Vigilance Committees.','\"[\\\"Improved Awareness of Legal Rights and Duties\\\",\\\"Empowerment of Marginalized Communities\\\",\\\"Early Conflict Resolution - Legal knowledge enables communities to handle disputes constructively before they escalate.\\\"]\"','Everything happened as planned','Not applicable',0,NULL,NULL,NULL,'2025-12-19 22:41:46','2025-12-19 22:41:46'),(2,'DP-0008-01-002','DP-0008-OBJ-02','DP-0008-01','To establish and strengthen Pratyasha committees ( mediation teams ) in social development centers for mediation and support.','\"[\\\"Functional Legal Committees at the Grassroots Level \\\\u2013 Legal committees are set up and actively operating within three social development centers.\\\",\\\"Timely and Effective Mediation of Disputes \\\\u2013 Social conflicts are resolved promptly through  peaceful, and community-based mediation.\\\",\\\"Support System for Vulnerable Individual \\\\u2013 Women and marginalized groups receive immediate guidance, legal aid, and moral support.\\\",\\\"Improved Documentation and Record-Keeping -  Cases, resolutions, and follow-up actions are systematically recorded, ensuring accountability and continuity\\\"]\"','Not applicable','Not applicable',0,NULL,'-','-','2025-12-19 22:41:46','2025-12-19 22:41:46'),(3,'DP-0008-01-003','DP-0008-OBJ-03','DP-0008-01','To undertake and file legal suits in courts to support clients in need of formal justice','\"[\\\"Increased Access to Formal Justice Systems \\\\u2013 Marginalized and vulnerable individuals are able to seek justice through proper legal channels.\\\",\\\"Empowerment of Clients Through Legal Representation -  Individuals feel supported and dignified by having competent legal backing\\\",\\\"Resolution of grievances\\\"]\"','Not applicable','Not applicable',0,NULL,NULL,NULL,'2025-12-19 22:41:46','2025-12-19 22:41:46'),(4,'DP-0008-01-004','DP-0008-OBJ-04','DP-0008-01','To build a legal resource center by developing a law library and networking with senior legal experts and organizations','\"[\\\"1.\\\\tEstablished Legal Resource Center with Updated References\\\\r\\\\nA functional center equipped with legal texts, case laws, manuals, and user-friendly materials for community use.\\\",\\\"Faster and Informed Legal Decision-Making\\\\r\\\\n\\\\u2013 Access to legal materials allows for quicker clarification of laws and appropriate actions.\\\",\\\"Creation of a Centralized Knowledge Repository\\\\r\\\\n\\\\u2013 Documentation of local cases, legal interventions, and best practices for replication and learning.\\\"]\"',NULL,NULL,0,NULL,NULL,NULL,'2025-12-19 22:41:46','2025-12-19 22:41:46'),(5,'DP-0008-02-001','DP-0008-OBJ-01','DP-0008-02','To increase legal literacy and awareness for the women, youth and formation of Vigilance Committees.','\"[\\\"Improved Awareness of Legal Rights and Duties\\\",\\\"Empowerment of Marginalized Communities\\\",\\\"Early Conflict Resolution - Legal knowledge enables communities to handle disputes constructively before they escalate.\\\"]\"',NULL,NULL,0,NULL,NULL,NULL,'2025-12-19 22:49:46','2025-12-19 22:49:46'),(6,'DP-0008-02-002','DP-0008-OBJ-02','DP-0008-02','To establish and strengthen Pratyasha committees ( mediation teams ) in social development centers for mediation and support.','\"[\\\"Functional Legal Committees at the Grassroots Level \\\\u2013 Legal committees are set up and actively operating within three social development centers.\\\",\\\"Timely and Effective Mediation of Disputes \\\\u2013 Social conflicts are resolved promptly through  peaceful, and community-based mediation.\\\",\\\"Support System for Vulnerable Individual \\\\u2013 Women and marginalized groups receive immediate guidance, legal aid, and moral support.\\\",\\\"Improved Documentation and Record-Keeping -  Cases, resolutions, and follow-up actions are systematically recorded, ensuring accountability and continuity\\\"]\"',NULL,NULL,0,NULL,NULL,NULL,'2025-12-19 22:49:46','2025-12-19 22:49:46'),(7,'DP-0008-02-003','DP-0008-OBJ-03','DP-0008-02','To undertake and file legal suits in courts to support clients in need of formal justice','\"[\\\"Increased Access to Formal Justice Systems \\\\u2013 Marginalized and vulnerable individuals are able to seek justice through proper legal channels.\\\",\\\"Empowerment of Clients Through Legal Representation -  Individuals feel supported and dignified by having competent legal backing\\\",\\\"Resolution of grievances\\\"]\"',NULL,NULL,0,NULL,NULL,NULL,'2025-12-19 22:49:46','2025-12-19 22:49:46'),(8,'DP-0008-02-004','DP-0008-OBJ-04','DP-0008-02','To build a legal resource center by developing a law library and networking with senior legal experts and organizations','\"[\\\"1.\\\\tEstablished Legal Resource Center with Updated References\\\\r\\\\nA functional center equipped with legal texts, case laws, manuals, and user-friendly materials for community use.\\\",\\\"Faster and Informed Legal Decision-Making\\\\r\\\\n\\\\u2013 Access to legal materials allows for quicker clarification of laws and appropriate actions.\\\",\\\"Creation of a Centralized Knowledge Repository\\\\r\\\\n\\\\u2013 Documentation of local cases, legal interventions, and best practices for replication and learning.\\\"]\"',NULL,NULL,0,NULL,NULL,NULL,'2025-12-19 22:49:46','2025-12-19 22:49:46');
