INSERT INTO `project_IAH_health_condition` VALUES (1,'IAH-HEALTH-0001','IAH-0001',NULL,1,'Dr Amreddy Austism at Hyderabad              And   Dr. Bindu child neuro care at Vijayawada',NULL,NULL,'Rahul Mathew is a five-year-old boy who is currently unable to speak. However, doctors are hopeful that with the proper treatment, he will be able to develop speech abilities. Rahul requires a combination of speech therapy, behavioural therapy, and occupational therapy to support his overall development. For the treatment to be effective, he needs to stay in the hospital under professional supervision for a specific period. Early and consistent intervention is essential for his progress, and with timely support, there is a strong possibility that Rahul will make significant improvements in communication and daily living skills.','Rahul Mathew’s family is facing difficult financial and personal challenges. His mother is physically handicapped and stays at home as a housewife. Due to her disability, she is unable to take up any form of employment, but she manages the household responsibilities with great effort. His father is a daily wage laborer who works hard each day to support the family. Despite his dedication and hard work, the income he earns is unstable and barely enough to cover their daily expenses. The family lives in poverty but remains hopeful and committed to doing everything they can for Rahul\'s well-being. However, their limited resources make it difficult to afford the specialized treatments Rahul urgently needs.','2025-12-08 14:49:16','2025-12-08 14:49:16'),(2,'IAH-HEALTH-0002','IAH-0002','Heart disease.',1,'Dr.V.Sujatha, M.D.D.M ( cardiology)','Indus Hospital.','Dr.V.Sujatha, M.D.D.M ( cardiology)\r\n   Indus Hospital,\r\n   Jagadamba junction,\r\n    Visakhapatnam Dt. A.P','Mr. Nathan Selvanayagam is suffering with Heart problems.  Four years ago he had severe heart attack which damaged his muscles. Now he has developed one more sickness that he is feeling burning sensation under his feet due to financial problem he is unable to go to hospital for his treatment. He had heart surgery, now he is under medication and medicine which is very expensive. Every day he has to take medicine, recently he went to meet doctor and she changed his medicine. \r\nLifelong he has to take medicine. This year he is advised to have taro check up.  He is thankful to you dear mother for your help.','Mr. Nathan Selvanayagam is the only son and 5 daughters for his parents. He lost his parents when he was very young. With much struggles and difficulties, he got 5 sisters married. Out of the 5 sisters got married, 2 of them lost their husbands and they are back home with their children. One of his sisters passed away in the year 2021. The whole responsibility of looking after the family is laid upon him. His health was affected very badly due to the tension of carrying out the daily house hold activities with these sisters and he had severe heart attack which damaged his muscles. He had to undergo treatment and medication which is very expensive.','2025-12-29 09:30:46','2025-12-29 09:30:46');
/*!40000 ALTER TABLE `project_IAH_health_condition` ENABLE KEYS */;
UNLOCK TABLES;

