INSERT INTO `project_IES_immediate_family_details` VALUES (1,'IES-FAMDET-0001','IOES-0001',0,0,0,0,0,NULL,0,0,0,0,NULL,0,0,0,0,NULL,0,0,NULL,'Family situation of the beneficiary\r\n\r\nMs. Kalam Durga Bhudevi is a very poor girl from Makavarapalem, completed her Intermediate. She has Parents and one younger brother. Her father and mother, both are Coolie workers.  Her brother is studying in first year ITI.  Her parents go for work, whenever they get work. They are financially very poor. Bhudevi, being a very clever girl, wants to study and help her parents. But due to financial problem, she cannot even imagine going for further higher studies. The family is struggling to meet even their basic needs.','Ms. K.Durga Bhudevi is a very poor girl who has completed her first year GNM at school of nursing    in Malkapuram. Her parents are unable pay the fees in the School as well as in the hostel. So dear mother, we request your financial support to continue to full fill her dream of becoming a staff Nurse to support her family as well as to help others who are like her in the Society.',0,NULL,0,NULL,'2025-12-27 17:50:21','2025-12-27 17:50:21');
