INSERT INTO `project_IGE_development_monitoring` VALUES (1,'IGE-DEVM-0001','IOGEP-0001','•	They are given ample opportunities to participate all types of extracurricular activities, individual and group as well\r\n•	They are asked to take up leadership roles as committee leaders, SNA (students’ nurses association)\r\n•	Various seminars are conducted to form their personality and for future career\r\n•	They too conduct workshops, seminars in their final years','Academic performances are conducted through term exams, university and board exams as per rules. Their other talents are monitored by various competitions on different occasions in the college.',NULL,'This project has helped many poor girls to equip themselves with a professional knowledge and get employed in well reputed hospitals, saved many families the burden of educating the girls and brought about  essential changes in their personality. We thank you whole heartedly.','2025-12-22 16:01:04','2025-12-31 13:23:14'),(2,'IGE-DEVM-0002','IOGEP-0002',NULL,NULL,NULL,NULL,'2025-12-24 21:18:30','2025-12-24 21:18:30'),(3,'IGE-DEVM-0003','IOGEP-0003','Follow up their studies.','The project will be monitored on a regular basis for making it more effective. And accountable. The process of monitoring involves the following steps:\r\n•	Staffs will guide the youth to meet the project goals.\r\n•	Proper completion of the activities as per the objectives of the project.\r\n•	Regular follow-up will be held.\r\n•	Youth will be encouraged to make decision for themselves and implement them. \r\n•	Scientific collection of date\r\n•	Personal meeting interviews and mentoring of the youth.\r\n•	Compilation of success stories.','Periodic field visits and date generation \r\nReporting 1) Monthly activity reports, 2) once in four months progress reports and 3) annual reports.\r\nGetting feedback of the beneficiaries from the institutions oral/written','This project aimed at strengthening the tribal youth for gainful employment. We are grateful to the donors for their encouragement and support','2025-12-27 09:04:25','2025-12-27 10:42:50'),(4,'IGE-DEVM-0004','IOGEP-0004','Encouraging activities like mindfulness, goal settings and time management for self development. We are also encouraging creativity through workshops sparks innovation and problem – solving skills. We are encouraging to participate in sports which are promotes physical well being and team work attending workshops on various subjects provides practical knowledge and exposure to diverse perspectives. Students are also encouraged to join in clubs like debate robotics or art can enhance skills and foster teamwork. Engaging in eco-friendly projects instills senses of responsibility towards the environment. We are encouraging leadership roles in student’s parliament to develop leadership skills.','Encourage students to maintain portfolios showcasing their best work, allowing both students and educators to track progress and identify areas for improvement. Observe students during class activities discussions and group work to assess their participation communication skills and ability to collaborate with peers. Timely track students physical development through periodic assessments to their fitness levels, motor skills and overall health .Encourage students to reflect on their own growth and development and incorporate peer assessment fostering a sense of responsibilities for one’s own learning regular meetings with parents will be conducted to discuss a students’ progress, behavior and overall development','Teachers play a crucial role assessing student’s progress through regular quizzes, assignments and class participation. Teachers provide constructive feedback high lighting strengths and areas for improvement fostering a growth mindset .Teachers conduct standardized tests to measure students academic proficiency and compare their performance at a broader level. For subjects like physical education and arts specialized instructors assess students based on specific criteria. School counselors are provided to assess students’ emotional and social development, by providing valuable insights into their well- being. \r\n     A collaborative effort among teachers, parents and support staff are seen for a comprehensive evaluation of student’s growth. There is closer collaboration maintained among management, staff, parents and students','From our study of the project supporting and empowering economically disadvantaged students is wonderful and marvelous in the sight of everyone. By investing in education, providing resources and addressing systematic challenges helped us to break the cycle of poverty and create opportunities for a brighter future for all students, irrespective of their financial circumstances. your generosity and compassion play a crucial role in breaking down barriers to education for those facing financial hardships .we thank God he made you as an effective instrument to wipe away tears from these 100 students. May the Good God who began his hard work continue to bless you & use for the greatest glory of God. We are grateful to all those who helped us to do act s of mer','2025-12-30 09:46:21','2025-12-30 23:25:35');
/*!40000 ALTER TABLE `project_IGE_development_monitoring` ENABLE KEYS */;
