INSERT INTO `project_IGE_institution_info` VALUES (1,'IGE-INST-0001','IOGEP-0001','Institutional','YOUTH',11,NULL,'2025-12-22 16:01:04','2025-12-22 16:01:04'),(2,'IGE-INST-0002','IOGEP-0002','Institutional','CHILDREN',4,'44','2025-12-24 21:18:30','2025-12-24 21:18:30'),(3,'IGE-INST-0003','IOGEP-0003','Institutional','YOUTH',18,'Make sure the wandering youth become people responsible for their family and society.','2025-12-27 09:04:25','2025-12-27 09:28:51'),(4,'IGE-INST-0004','IOGEP-0004','Institutional','CHILDREN',784,'Project support helped students to develop and enhance essential skills such as research, problem solving and increased their confidence .in their abilities fostering a belief in their capacity to tackle challenges. Out of 100 students who passed out of the school, 10 are in high post, some of them working in post offices, some are teachers, nurses and bank employees and some are pursuing their studies.','2025-12-30 09:46:21','2025-12-30 09:46:21');
