INSERT INTO `project_IGE_new_beneficiaries` VALUES (31,'IGE-NBEN-0001','IOGEP-0003','Amrita Bara','ST','Navajara, Gola, Ramgarh, Jharkhand','1st','Amirtha Bara, a young married woman working in a project office, wishes to pursue a one-year Secretarial Course to enhance her skills and secure stable employment. Coming from a financially disadvantaged background and receiving little support from her alcoholic husband, she bears the full responsibility of her household. Amirtha seeks financial assistance to pursue this course and work towards a better future for herself and her family.','2025-12-27 11:09:47','2025-12-27 11:09:47'),(983,'IGE-NBEN-0002','IOGEP-0004','SHAIK PARVEEN','MUSLIM SHAIK (BC-E)','Do.No.15-641,Siva Sankar Nagar ,Arilova,Visakhapatnam.\r\nContact No 9533273878','2025-26','Sk.Parveen studying in 10th class in St.Ann;s school,Arilova . She has been benefiting from the project. Her parents are Sk.Hussain and Sk. Noorjahan, her father is a worker and mother is a daily coolie worker. As this family is persistently seeking for your generous help we humbly request you to turn your merciful eyes on this family and console them with your compassionate heart. she is good at studies and very gentle in her approach. She is very talented and affectionate.','2026-01-02 10:17:04','2026-01-02 10:17:04'),(984,'IGE-NBEN-0003','IOGEP-0004','SIRASA VARSHINI','KAPU (OC)','Do. No.13/878,Mustafa Colony,Arilova,Visakhapatnam.\r\nContact No 9348871878','2025-26','Sirasa Varshini studying in 10th class in St.Ann’s School,Arilova She has been benefiting from the project from the last few year. Her family is very poor. Her mother died of H.I.V in2021 and her father S.Hari Krishna is a coolie worker .They are staying along with her grandparents. Their life seems to be very hard to meet they basic needs  she good at studies and very talented good at organizing able and efficient leader she forget about herself in good company of friends.','2026-01-02 10:17:04','2026-01-02 10:17:04'),(985,'IGE-NBEN-0004','IOGEP-0004','UPPILI SRIJA','YADAVA (BC-D)','Do,No.16-305,Kanakamahalakshmi Nagar ,Arilova,Visakhapatnam.\r\nContact No 7893316536','2025-26','studying in 10th class in st.ann\'s school,arilova she has been benefiiting from the project from the last year','2026-01-02 10:17:04','2026-01-02 10:17:04'),(986,'IGE-NBEN-0005','IOGEP-0004','NODAGALA MAHALAKSHMI','YADAVAS (BC-D)','13-1155,Drivers Colony,Arilova,Visakhapatnam.\r\nContact No 7288924311','2025-26','nodagala mahalakshi','2026-01-02 10:17:04','2026-01-02 10:17:04'),(987,'IGE-NBEN-0006','IOGEP-0004','BANDARI SUMA','KUNAPULI (BC-A)','Do.No.12-244/1,Balaji Nagar,Arilova,Visakhapatnam.\r\nContact No 7095967824','2025-26',NULL,'2026-01-02 10:17:04','2026-01-02 10:17:04'),(988,'IGE-NBEN-0007','IOGEP-0004','SHAIK SHAJEEDA','MUSLIM (SHAIK BC-E)','Do.No.13-967 ,Bharath Nagar ,Arilova,VIskhapatnam\r\nContact No 7732046567','2025-26',NULL,'2026-01-02 10:17:04','2026-01-02 10:17:04'),(989,'IGE-NBEN-0008','IOGEP-0004','GOPI NAVYA','PADMASALI (BC-B)',',Do No 15-371,Durga Bazar,Bhagathsingh Nagar,Arilova,Visakhapatnam.\r\nContact No: 7036878967','2025-26',NULL,'2026-01-02 10:17:04','2026-01-02 10:17:04'),(990,'IGE-NBEN-0009','IOGEP-0004','SAMIREDDY SOWMYA','VELAMA (OC)','13-4792,Parvathi Nagar ,Arilova,Visakhapatnam.\r\nContact No: 8978597965','2025-26',NULL,'2026-01-02 10:17:04','2026-01-02 10:17:04'),(991,'IGE-NBEN-0010','IOGEP-0004','CHITTIGOLLA DIVYA','MALA (SC GRADE -III)','Do No.5-605/112,BNR Nagar,Arilova ,Visakhapatnam.\r\nContact No:9133922706','2025-26',NULL,'2026-01-02 10:17:04','2026-01-02 10:17:04'),(992,'IGE-NBEN-0011','IOGEP-0004','ALABANA HEMA','YADAVAS (BC-D)','),Do.No.6-364/1,Srihari Nagar,Arilova,Visakhapatnam.\r\nContact No 9010498246','2025-26',NULL,'2026-01-02 10:17:04','2026-01-02 10:17:04'),(993,'IGE-NBEN-0012','IOGEP-0004','METIKOTI DIVYA','VISWABRAHMIN (BC-B)','Do.No.23-224,Pedagadili,Visakhapatnam.\r\nContact No 6281312799','2025-26',NULL,'2026-01-02 10:17:04','2026-01-02 10