INSERT INTO `project_IGE_ongoing_beneficiaries` VALUES (325,'IGE-ONGB-0001','IOGEP-0003','Anamika Gari','ST','Navajara, Gola, Ramgarh, Jharkhand','3rd year','Anamika is learning to speak English far better and she is confident in it. Though she had poor educational background, she is trying to cope up with her studies by putting extra efforts. She is studying second year GNM at Malakapuram. She requests for financial support for the third year.','2025-12-27 11:09:47','2025-12-27 11:09:47'),(326,'IGE-ONGB-0002','IOGEP-0003','Jamuna Kumari','ST','Machatanr, Gola, Ramgarh, Jharkhand','3rd year','Jamuna is very grateful for the opportunity she received to study GNM. She comes from a very interior village. After completed inter she was staying at home and taking care of her bedridden father. She could go ahead with her dreams only because of the benefactors. Her study is satisfactory. She is making use of every opportunity to become a good nurse. She is studying second year GNM at Malakapuram. and she stands in need of financial support for the third year.','2025-12-27 11:09:47','2025-12-27 11:09:47'),(327,'IGE-ONGB-0003','IOGEP-0003','Dipthi Archana','ST','Vijaydish, Gola, Ramgarh, Jharkhand','3rd year','She is studying second year GNM in St. Joseph School of Nursing. She studies well and she got skilled in English. She helps other weak students to study and ‘she is one of the best students’, says her teacher. As she moves on to the third year she needs financial support to pay her fees.','2025-12-27 11:09:47','2025-12-27 11:09:47'),(328,'IGE-ONGB-0004','IOGEP-0003','Nimothy Kumari','ST','Vijaydih, Gola, Ramgarh, Jharkhand','3rd','She is a tribal girl who never came out of her village. For her, everything was very new when she started her studies but she got adapted to the place and she takes keen interest for her studies. She was very timid and she never seems to be happy but later on she has become very smart and very joyful. She is doing second year GNM  at St. Joseph \r\nand she request help for the third -year payment.','2025-12-27 11:09:47','2025-12-27 11:09:47'),(329,'IGE-ONGB-0005','IOGEP-0003','Raju Karmali','ST','Konardih, Gola, Ramgarh, Jharkhand','2nd','One youth named Raju Karmali had appeared for entrance exam for B Ed. He worked hard and the team encouraged him to prepare well. He is in the merit list and he got admission in a government college at Ramgarh. He is happy and doing well. He completer first semester.','2025-12-27 11:09:47','2025-12-27 11:09:47'),(330,'IGE-ONGB-0006','IOGEP-0003','Karmali Linda','ST','Navajara, Gola, Ramgarh, Jharkhand','1st','Kamali Linda got qualified in government entrance exam and got her admission for ANM at Holy Family Nursing School Koderma.  She is doing well and passed all the subjects She needs further financial assistance to continue her studies.','2025-12-27 11:09:47','2025-12-27 11:09:47'),(331,'IGE-ONGB-0007','IOGEP-0003','Pumila Kumari','ST','Vijedih, Gola, Ramgarh, Jharkhand','2nd','She hails from poor economic back ground, she is studying second year BAC at Ambikapur She is a smart girl, excels in her studies. They are 5 children and parents are farmers. The eldest boy studied only up to 8th class and started to go for work, the elder girl were given marriage due to poverty at home. There are two more sisters who are studying in lower classes. If she is supported to go for higher studies it will be a great help for the upliftment of family.','2025-12-27 11:09:47','2025-12-27 11:09:47'),(332,'IGE-ONGB-0008','IOGEP-0003','Sulekha Kumari','ST','Kusumajara, Gola, Ramgarh, Jharkhand','1st','Sulekha Kumari has recently joined St. Ann’s College of Nursing, Malakapuram, in October to pursue a General Nursing and Midwifery (GNM) course. Having previously worked at one of our health centres while completing her intermediate studies, she finds it easier to adapt nursing studies. Sulekha is thrilled to be a part of this esteemed institution and is eager to excel in her chosen field.','2025-12-27 11:09:47','2025-12-27 11:09:47'),(333,'IGE-ONGB-0009','IOGEP-0003','Saraswathi Kumari','ST','Barki Hesal Gola, Ramgarh, Jharkhand','1st','Saraswathi Kumari received admission to St. Ann’s school of Nursing in Malakapuram and joined the institution in October. She is overjoyed and deeply grateful for the opportunity to study such a prestigious institution. She now considers this opportunity to pursue nursing as a significant milestone in her journey, allowing her to develop valuable skills and build a promising future.','2025-12-27 11:09:47','2025-12-27 11:09:47'),(974,'IGE-ONGB-0086','IOGEP-0001','N Akshaya','BC - B','D/o. N.Kanaka Raju\r\nD. No. 60-29-63/1, Janatha Colony, Malkapuram Post\r\nVisakhapatnam - 530011','GNM 2ND YEAR','She got 786 marks in Intermediate MPHW with 79%. She completed  her GNM 1st  year board exam and waiting for her results.She gets sick often and trying her best to  improve further .','2025-12-31 14:38:14','2025-12-31 14:38:14'),(975,'IGE-ONGB-0087','IOGEP-0001','A Mamatha','BC-D','D/o. Srinu,\r\nKothapenta, Devarapalli, Visakhapatnam - 531034','GNM 2ND YEAR','She got 653 marks in Intermediate MPHW with 65%. She completed her GNM 1st year board exam and waiting for her results. She needs to focus on her academic performance. She is been confronted when makes mistakes and is trying her best to improve in all aspects.','2025-12-31 14:38:14','2025-12-31 14:38:14'),(976,'IGE-ONGB-0088','IOGEP-0001','P Moulika','SC','D/o. P. Vijaya Lakshmi, D.NO: 60-30-53/1, Janatha Colony, Near Durga Temple, Malkapuram, Visakhapatnam-530011.','GNM 3RD YEAR','She passed  GNM 1st year  in 1st class with 66% got  331 Marks    .   She wrote her 2nd year board exams and waiting for the result. She is a good and hardworking student. She is trying her best to improve in all aspects.','2025-12-31 14:38:14','2025-12-31 14:38:14'),(977,'IGE-ONGB-0089','IOGEP-0001','P Venkata Lakshmi','BC-D','D/o. P. Gurunadha Rao, H. No 1-146, Settibalija Veedhi, Paravada