INSERT INTO `project_IIES_immediate_family_details` VALUES (1,'IIES-FAM-0001','IIES-0001',0,0,0,0,0,NULL,0,0,0,0,NULL,0,0,0,0,NULL,0,1,NULL,'Family situation of the beneficiary\r\n\r\nCheedi Yugandhar has parents and has one younger sister she is studying in class 10th. He is good at studies; wishes to continue his second year Inter mediate (MPC). Recently his father met with an accident now he is under rest .now in the family earning member only his mother.   Due to financial constrains he is unable to pay the college and hostel fees. Her father is working as a coolie and mother works as an ayah at St.Ann’s convent. With the wages they are unable to pay the college and hostel fees. They are struggling to meet their basic needs. In this situation he is unable to continue his studies, without the help of someone like you.','Cheedi Yugandhar is a very poor boy who has completed his first year Inter mediate (MPC) he passed with good marks (300). His parents are unable pay the fees in the college as well as in the hostel. So dear mother, we request your financial support to continue to full fill his dream of becoming an engineer to support his family as well as to help others who are like him in the Society.',0,'No',1,'Yes: My mother is working as an ayah in St. Ann’s convent, Butchirajupalem.','2025-12-28 11:49:07','2025-12-29 12:23:22'),(2,'IIES-FAM-0002','IIES-0002',0,0,0,0,0,NULL,0,0,0,0,NULL,0,0,1,0,NULL,0,1,NULL,'Miss. Mandingi Sarayu is a poor girl her parents are illiterate. Her father is a driver in our Convent. She is writing her Diploma first year exam. Now she is in second year Diploma and is unable to clear the tuition fee of the college due to less income of the family.  She has a great desire to study further   and become a software engineer to support the family. Her mother is having TB and she is under medication and she is with Disability (mute).','Miss. Mandingi Sarayu is a very poor girl. Who has completed her first year of Diploma (CME).   Her parents are unable to pay the college fee. So dear mother we request your financial support to continue to fulfill her dream of becoming a software engineer.\r\n\r\nThe generosity of our benefactors would surely give a future to the poor girl who in turn would help her family. They would be ever grateful for the financial help rendered and would keep you in their daily prayers. We will be ever indebted to you for your kindness and generosity.',0,NULL,1,'Yes, Her Father is working as driver in the Convent.','2025-12-28 12:27:11','2025-12-29 12:41:59'),(3,'IIES-FAM-0003','IIES-0003',0,1,0,0,0,NULL,0,0,0,0,'no more',0,0,0,0,'Healthy',0,1,NULL,NULL,NULL,0,NULL,0,NULL,'2026-01-02 17:20:56','2026-01-02 17:41:14'),(4,'IIES-FAM-0004','IIES-0004',0,0,0,0,0,NULL,0,0,0,0,NULL,0,0,0,0,NULL,0,0,NULL,NULL,NULL,0,NULL,0,NULL,'2026-01-10 11:12:41','2026-01-10 11:12:41');
