INSERT INTO `project_ILP_personal_info` VALUES (1,'ILP-PERS-0001','ILA-0001','Mr.Porapu Gopala Rao',57,'Male','1968-07-01',NULL,'9866830078','918891357584','S/o Porapu Syman, 1-104,\r\nNIDAGALLU, Nidagallu,\r\nVizianagaram, Andhra Pradesh - 535546','Driver','Married','Mrs.Porapu Jyothi',2,'Son is studying for IIT (B.Tech), Daughter finished degree.','Catholics',NULL,'Mr. Porapu Gopala Rao is living in a rented house. He is having two children, Son is studying for IIT (B. Tech), he goes for half day for work the money he gets with that money he is able to study, and Daughter finished degree. She is interest in sports. Mr. Porapu Gopala Rao is a poor man due to his ill health (Heart disease) he had heart surgery, now   he is at home feeling better. His earning was the only income for the family. He has lost his job as he fell sick; Lifelong he has to take medicine. He is survived with his wife was going for Coolie work but she was bitten by rats five times during the night. She was taking treatment. For few days she didn’t go for work, so they removed her from the work now she is at home. They are really struggling to meet the day today needs. He likes to have a small auto, this will help his to earn and have better living.',0,NULL,4000.00,'Explain the Beneficiaries present business idea:\r\nSince he was a lorry driver. Because of his ill health he was under rest. Now he is feeling better so he likes to have one small auto which will be helping him to earn and have better living and to take care of the his family.','2025-12-29 12:05:00','2025-12-29 12:05:00');
