INSERT INTO `project_attachments` VALUES (1,'DP-0001','project_attachments/Development_Projects/DP-0001/3__Villages_project_in_Jaggayyapeta.docx','3__Villages_project_in_Jaggayyapeta.docx',NULL,'/storage/project_attachments/Development_Projects/DP-0001/3__Villages_project_in_Jaggayyapeta.docx','2025-11-25 12:35:59','2025-11-25 12:35:59'),(2,'DP-0003','project_attachments/Development_Projects/DP-0003/Tution_Centers_Project.docx','Tution_Centers_Project.docx',NULL,'/storage/project_attachments/Development_Projects/DP-0003/Tution_Centers_Project.docx','2025-11-25 12:37:37','2025-11-25 12:37:37'),(3,'DP-0002','project_attachments/Development_Projects/DP-0002/CHILDREN_PROJECT_DATA-2025.pdf','CHILDREN_PROJECT_DATA-2025.pdf','BENEFICIARY  DETAILS OF THE   CHILDREN PROJECT','/storage/project_attachments/Development_Projects/DP-0002/CHILDREN_PROJECT_DATA-2025.pdf','2025-11-25 12:46:12','2025-11-25 12:46:12'),(4,'DP-0004','project_attachments/Development_Projects/DP-0004/Village_development_project_3rd_phase_-2025.docx','Village_development_project_3rd_phase_-2025.docx','Village Avanigadda in Machilipatnam Mandal in Krishna district of Andhra Pradesh is 65 km away from coastal Krishna River in Vijayawada in Andhra Pradesh. Being close to the Bay of Bengal, Avanigadda and its surrounding villages are made vulnerable owing to recurrent floods and cyclonic storms. This has in turn brings uncertainties in the lives and livelihoods of people in these villages','/storage/project_attachments/Development_Projects/DP-0004/Village_development_project_3rd_phase_-2025.docx','2025-11-25 12:57:29','2025-11-25 12:57:29'),(5,'DP-0005','project_attachments/Development_Projects/DP-0005/adolescent_girls.docx','adolescent_girls.docx',NULL,'/storage/project_attachments/Development_Projects/DP-0005/adolescent_girls.docx','2025-11-25 13:09:34','2025-11-25 13:09:34'),(6,'DP-0007','project_attachments/Development_Projects/DP-0007/Intuitional_care_for_15_destitute_home.doc','Intuitional_care_for_15_destitute_home.doc',NULL,'/storage/project_attachments/Development_Projects/DP-0007/Intuitional_care_for_15_destitute_home.doc','2025-12-05 14:15:11','2025-12-05 14:15:11'),(9,'DP-0010','project_attachments/Development_Projects/DP-0010/Project_on_Tuition_Center.docx.pdf.pdf','Project_on_Tuition_Center.docx.pdf.pdf','This project aims to empower economically disadvantaged students from nine villages by providing supplementary learning support that strengthens academic performance and equips them with essential life skills. It focuses on three key areas: improving students’ learning outcomes, enhancing teachers’ capacity to support slow learners, and engaging parents to become active partners in their children’s education. Through regular remedial classes, assessments, teacher training, and parent awareness programs, the project seeks to reduce dropout rates, build confidence, and create a supportive learning environment that helps every child progress towards a brighter future.','/storage/project_attachments/Development_Projects/DP-0010/Project_on_Tuition_Center.docx.pdf.pdf','2025-12-09 09:01:40','2025-12-09 09:01:40'),(11,'DP-0015','project_attachments/Development_Projects/DP-0015/test_file_is_the_nmae_of_project.pdf','test_file_is_the_nmae_of_project.pdf','test file is the nmae of projecttest file is the nmae of projecttest file is the nmae of projecttest file is the nmae of projecttest file is the nmae of projecttest file is the nmae of projecttest file is the nmae of projecttest file is the nmae of projecttest file is the nmae of projecttest file is the nmae of projecttest file is the nmae of projecttest file is the nmae of projecttest file is the nmae of projecttest file is the nmae of projecttest file is the nmae of projecttest file is the nmae of projecttest file is the nmae of projecttest file is the nmae of project','/storage/project_attachments/Development_Projects/DP-0015/test_file_is_the_nmae_of_project.pdf','2025-12-11 17:43:23','2025-12-11 17:43:23'),(12