s of S.A. Peta and Rajavaram in Agiripalli mandal, Eluru district in Andhra Pradesh, waste management has become a significant concern due to limited intervention from the government, inadequate infrastructure and poor awareness among the community have intensified the improper disposal. The absence of a proper waste collection system and designated dumping yards have led to the frequent disposal of waste in open areas or burning, resulting in air, water and soil pollution leading to environmental degradation and health hazards. This situation underscores the urgent need for a systematic and sustainable waste management approach to improve environmental health and community well-being.','/storage/project_attachments/Development_Projects/DP-0020/waste_management.docx','2025-12-14 21:01:36','2025-12-14 21:01:36'),(17,'DP-0006','project_attachments/Development_Projects/DP-0006/problem_Analysis.pdf','problem_Analysis.pdf','Details of youth','/storage/project_attachments/Development_Projects/DP-0006/problem_Analysis.pdf','2025-12-15 12:29:07','2025-12-15 12:29:07'),(18,'IOGEP-0003','project_attachments/Institutional_Ongoing_Group_Educational_proposal/IOGEP-0003/Youth_Project_Fee_Structure.pdf','Youth_Project_Fee_Structure.pdf','Gives you details of the fees at different institutions for our beneficiaries','/storage/project_attachments/Institutional_Ongoing_Group_Educational_proposal/IOGEP-0003/Youth_Project_Fee_Structure.pdf','2025-12-27 11:07:04','2025-12-27 11:07:04'),(19,'DP-0024','project_attachments/Development_Projects/DP-0024/Empowering_400_Single_women.docx','Empowering_400_Single_women.docx',NULL,'/storage/project_attachments/Development_Projects/DP-0024/Empowering_400_Single_women.docx','2026-01-04 16:44:03','2026-01-04 16:44:03'),(20,'DP-0025','project_attachments/Development_Projects/DP-0025/Empowering_400_Marginalised_Familes_2nd_phase.docx','Empowering_400_Marginalised_Familes_2nd_phase.docx',NULL,'/storage/project_attachments/Development_Projects/DP-0025/E