INSERT INTO `project_cic_basic_info` VALUES (1,'CIC-BI-0001','CIC-0001',716,135,'a. Unwed mothers\r\n   b) Women victims of domestic violence\r\n   c) POCSO victims\r\n   d) Victims of child marriage\r\n   e) Victims of begging\r\n   f) Ragpickers.\r\n   g) Victims of harassment by step parents.\r\n    h) Complete orphan with no guardian  \r\n    i) Women with family calamities \r\n    j) Women and children rescued from trafficking','our centre stands as a beacon of hope for individuals—especially women and children—who are facing crises such as trauma, abuse, abandonment, or violence. For years, we have played a critical role in responding to emergencies, offering immediate and compassionate support, and restoring dignity to lives shattered by adversity. We are more than a shelter—we are a home away from home.\r\nWe provide round-the-clock care that ensures physical, emotional, and psychological safety, particularly in cases of domestic violence, child abuse, human trafficking, and social abandonment. Our trained psychologists offer both individual and group counseling to help survivors process trauma, overcome fear, and begin emotional healing. In addition, psychiatric care and de-addiction therapy are available for those who need them.\r\nOur holistic rehabilitation approach includes skill development, educational support, and job placement services to help survivors rebuild their lives. Where appropriate, we offer family counseling and mediation to support reintegration into safe family environments or help individuals start afresh independently.\r\nWe also accompany victims of the Protection of Children from Sexual Offences (POCSO) Act through legal proceedings, ensuring they receive the necessary support throughout the judicial process.','Our beneficiaries are mostly from poor and vulnerable families. Many children, especially girls, do not go to school or leave school early. Some girls are married at     a young age. Women usually have little say in family or community decisions.\r\n                           Most families earn very little and live hand to mouth.They depend on daily wage work and have no savings. When problems happen, they borrow money with high interest and fall into debt. Many young people and women do not have jobs.\r\n                 People still follow old customs and traditions. When girls reach puberty, families often arrange their marriage early because they worry about their safety. This makes many girls stop going to school. Most people speak local languages, so it can be hard to share information if it’s not in their language. Some people also resist new ideas unless they are shared in a respectful and familiar way.','The beneficiaries face many problems in their daily lives. Poverty is the main issue. Because of low income, they cannot meet basic needs like food and healthcare. This often leads to malnutrition, especially in children.\r\nAnother big problem is lack of education. Many children drop out of school, and girls are often married off at a young age. This takes away their chance for a better future and makes them more likely to face violence and abuse.\r\nUnemployment is also a major issue, especially for women and young people. Without jobs, families remain poor. When there are emergencies, they borrow money at high interest rates, leading to debt and stress.\r\nGender inequality is common. Women have fewer rights and are often left out of important decisions. They are expected to stay at home and care for the family. Girls are not encouraged to study and are often married early, which causes health problems and early pregnancies.','One of the major issues is the lack of consistent commitment from staff, which places a greater burden on the remaining team members and impacts overall productivity. Additionally, the administrative demands made by the government continue to increase. We are required to carry out numerous activities and upload extensive data to designated portals. Unfortunately, clear instructions and proper guidance are often lacking, making these tasks difficult and time-consuming.\r\n        Moreover, frequent virtual meetings though well-intentioned have become excessive, consuming valuable time. Balancing these meetings with our core responsibilities is becoming increasingly challenging.\r\n                On the ground level, the beneficiaries require constant attention, supervision, and emotional support. Many are in vulnerable situations and need ongoing accompaniment, which demands significant time, care, and energy from staff. When new clients join the center, it is a particularly delicate and time-intensive process to help them adjust and feel at home. This phase requires sensitivity, patience, and a strong presence from the team.','We do not receive any support from the Govt,however we are grateful for the kind assistance we receive from the local community and well wishers. Some individuals contribute provisions, stationary and other essentials to support our activities. Notably one of our well wishers generously sponsored    our entire six months beautician training programme. Additionally the computer training  programme was  made possible through the support of a few generous benefactors','The project is very important today because we live in a society with many problems. Every day, we see the struggles faced by women and children, especially those who are poor, abused, or neglected. By addressing these issues and providing shelter and support to those in greatest need, we can bring real change. This project helps give hope to the hopeless and strength to the broken. It gives them a chance to live a safe, dignified, and meaningful life.','2025-11-25 11:53:59','2025-11-25 22:09:59');
