INSERT INTO `project_results` VALUES (29,'DP-0001-OBJ-01-RES-01','DP-0001-OBJ-01','•	1,000 children and community members gained knowledge on child rights, protection mechanisms, and life skills, leading to a safer and more supportive environment for children.','2025-11-25 12:35:59','2025-11-25 12:35:59'),(30,'DP-0001-OBJ-01-RES-02','DP-0001-OBJ-01','•	700 individuals, including girls and parents, developed a positive outlook on girls’ education and gender equality','2025-11-25 12:35:59','2025-11-25 12:35:59'),(31,'DP-0001-OBJ-01-RES-03','DP-0001-OBJ-01','•	300 children and youth gained critical thinking, decision-making, and emotional resilience, improving their confidence and adaptability','2025-11-25 12:35:59','2025-11-25 12:35:59'),(32,'DP-0001-OBJ-01-RES-04','DP-0001-OBJ-01','•	300 parents adopted positive parenting practices','2025-11-25 12:35:59','2025-11-25 12:35:59'),(33,'DP-0001-OBJ-02-RES-01','DP-0001-OBJ-02','•	500 women gained knowledge on menstrual hygiene, and disease prevention, leading to better health practices and early detection of health issues.','2025-11-25 12:35:59','2025-11-25 12:35:59'),(34,'DP-0001-OBJ-02-RES-02','DP-0001-OBJ-02','•	1,000 villagers received medical check-ups and treatment through health camps','2025-11-25 12:35:59','2025-11-25 12:35:59'),(35,'DP-0001-OBJ-02-RES-03','DP-0001-OBJ-02','•	45 elderly and differently-abled individuals received support.','2025-11-25 12:35:59','2025-11-25 12:35:59'),(36,'DP-0001-OBJ-02-RES-04','DP-0001-OBJ-02','•	9 Cleanliness drives led to improved sanitation, reduced waste accumulation, and lower risk of diseases','2025-11-25 12:35:59','2025-11-25 12:35:59'),(37,'DP-0001-OBJ-03-RES-01','DP-0001-OBJ-03','•	15 youth leadership programs conducted, engaged participants in 9 different activities that enhanced their leadership skills, teamwork, and social responsibility.','2025-11-25 12:35:59','2025-11-25 12:35:59'),(38,'DP-0001-OBJ-03-RES-02','DP-0001-OBJ-03','•	Networking efforts connected individuals and groups','2025-11-25 12:35:59','2025-11-25 12:35:59'),(39,'DP-0001-OBJ-03-RES-03','DP-0001-OBJ-03','•	3skill training sessions, equipped 100 beneficiaries with practical skills to improve their employability and livelihood opportunities.','2025-11-25 12:35:59','2025-11-25 12:35:59'),(40,'DP-0001-OBJ-03-RES-04','DP-0001-OBJ-03','•	15 individuals successfully established their own self-employment ventures, increasing financial independence and sustainability','2025-11-25 12:35:59','2025-11-25 12:35:59'),(41,'DP-0001-OBJ-03-RES-05','DP-0001-OBJ-03','•	Three Children’s Parliaments were formed, empowering 75 children to voice their concerns.','2025-11-25 12:35:59','2025-11-25 12:35:59'),(42,'DP-0001-OBJ-03-RES-06','DP-0001-OBJ-03','•	3 Village Development Committees with 30 members were established, actively participating in local governance and driving community-led development initiatives.','2025-11-25 12:35:59','2025-11-25 12:35:59'),(43,'DP-0003-OBJ-01-RES-01','DP-0003-OBJ-01','•	450 Children Improved academic performance and had deeper knowledge of subjects\r\n•	Increased confidence and motivation among children.\r\n•	Reduced dropout rates and better school attendance.\r\n•	Enhanced discipline and study habits.\r\n•	Strengthened relationships between teachers, students, and parents.','2025-11-25 12:37:37','2025-11-25 12:37:37'),(44,'DP-0003-OBJ-02-RES-01','DP-0003-OBJ-02','•	15 Children’s Parliaments actively functioned.\r\n•	450 children were engaged in decision-making and leadership activities.\r\n•	135 children demonstrated improved leadership and communication skills.\r\n•	270 children became more aware of their rights and responsibilities.','2025-11-25 12:37:37','2025-11-25 12:37:37'),(45,'DP-0003-OBJ-03-RES-01','DP-0003-OBJ-03','•	Strengthened parent-child relationships through awareness and guidance.\r\n•	Increased parental involvement in children’s education and personal growth.\r\n•	Improved understanding of child rights, positive parenting, and discip