5-12-19 21:48:24'),(724,'DP-0022-OBJ-02-RES-03','DP-0022-OBJ-02','Reduced school drop-out rates.','2025-12-19 21:48:24','2025-12-19 21:48:24'),(725,'DP-0022-OBJ-02-RES-04','DP-0022-OBJ-02','Increased school attendance and interest in learning.','2025-12-19 21:48:24','2025-12-19 21:48:24'),(726,'DP-0022-OBJ-02-RES-05','DP-0022-OBJ-02','Children will gain confidence and perform better in school exams.','2025-12-19 21:48:24','2025-12-19 21:48:24'),(727,'DP-0022-OBJ-02-RES-06','DP-0022-OBJ-02','Parents experience and see the holistic growth of their children','2025-12-19 21:48:24','2025-12-19 21:48:24'),(728,'DP-0022-OBJ-02-RES-07','DP-0022-OBJ-02','Adolescent girls / women are able to stitch their own garments and thus save money','2025-12-19 21:48:24','2025-12-19 21:48:24'),(764,'IOGEP-0003-OBJ-01-RES-01','IOGEP-0003-OBJ-01','Make sure the wandering youth become people responsible for their family and society.','2025-12-27 11:09:47','2025-12-27 11:09:47'),(765,'DP-0023-OBJ-01-RES-01','DP-0023-OBJ-01','Children learn better\r\nThey learn values\r\nThey develop communication skills\r\nThey become responsible citizens and contributors in the society development','2025-12-29 12:34:38','2025-12-29 12:34:38'),(782,'IOGEP-0001-OBJ-01-RES-01','IOGEP-0001-OBJ-01',NULL,'2025-12-31 14:38:14','2025-12-31 14:38:14'),(828,'IOGEP-0004-OBJ-01-RES-01','IOGEP-0004-OBJ-01','children will have good standard of education','2026-01-02 10:17:04','2026-01-02 10:17:04'),(829,'IOGEP-0004-OBJ-02-RES-01','IOGEP-0004-OBJ-02',NULL,'2026-01-02 10:17:04','2026-01-02 10:17:04'),(923,'DP-0012-OBJ-01-RES-01','DP-0012-OBJ-01','Results / Outcome\r\n1.	80% of farmers in the four villages receive training on organic farming techniques.\r\n2.	Increased understanding among farmers of the harmful effects of chemical fertilizers and pesticides.\r\n3.	Growing interest among farmers in transitioning to organic farming.\r\n4.	Awareness of the organic certification process is raised, empowering farmers to seek certification.\r\n5.	Positive behavioral changes are observed, such as reduced pesticide use and more sustainable land management practices.','2026-01-06 10:16:25','2026-01-06 10:16:25'),(924,'DP-0012-OBJ-02-RES-01','DP-0012-OBJ-02','Results / Outcome\r\n1.	30% of farmers in each village transition to organic farming practices.\r\n2.	A network of organic certification bodies is established, with 20% of farmers achieving certification.\r\n3.	Four local markets are created to sell organic produce.\r\n4.	Increased demand for organic produce in local markets as a result of awareness campaigns.\r\n5.	Farmers gain access to higher market prices for organic produce, leading to improved economic stability.','2026-01-06 10:16:25','2026-01-06 10:16:25'),(925,'DP-0012-OBJ-03-RES-01','DP-0012-OBJ-03','Results / Outcome:\r\n1.	The use of chemical fertilizers and pesticides is reduced by 50%.\r\n2.	Sustainable farming practices such as crop rotation, composting, and agroforestry are widely adopted.\r\n3.	Water contamination decreases due to the reduction of chemical runoff.\r\n4.	At least 10 demonstration plots are established, showcasing best practices in organic farming.','2026-01-06 10:16:25','2026-01-06 10:16:25'),(926,'DP-0012-OBJ-04-RES-01','DP-0012-OBJ-04','Results / Outcome:\r\n1.	Farmers and youth implemented eco-friendly farming techniques.\r\n2.	Schools and communities actively participated in eco-clubs and sustainability initiatives.\r\n3.	Communities adopted water preservation techniques, reduced wastage and improved access.\r\n4.	Establishment of home and school-based nutritional gardens ensured better food diversity.\r\n5.	Promotion of organic farming reduced soil degradation and chemical dependency.','2026-01-06 10:16:25','2026-01-06 10:16:25'),(927,'DP-0012-OBJ-05-RES-01','DP-0012-OBJ-05','1.	Farmer clubs are formed and actively functioning in all four villages, fostering peer learning and collective action.\r\n2.	At least 4 exposure visits are conducted to successful organic farms and agricultural departments.\r\n3.	Successful case stories of organic farmers are documented and shared across villages to inspire and encourage adoption.\r\n4.	Farmers participate in local festivals and exhibitions, displaying and selling their organic products to the community.\r\n5.	50% of interested farmers access agricultural loans or government schemes to support organic farming initiatives.','2026-01-06 10:16:25','2026-01-06 10:16:25'),(936,'DP-0013-OBJ-01-RES-01','DP-0013-OBJ-01','1.	40 Youth Parliaments are formally established and meet regularly.\r\n2.	At least 600 youth (50% girls) are trained in leadership, democratic values, and civic engagement.\r\n3.	80% of Youth Parliaments undertake at least two local community development or advocacy initiatives per year.\r\n4.	A minimum of 10 youth leaders per district emerge and take up roles in schools, community groups, or local committees.','2026-01-06 15:47:35','2026-01-06 15:47:35'),(937,'DP-0013-OBJ-02-RES-01','DP-0013-OBJ-02','Results / Outcome:\r\n1.	At least 300 youth demonstrate improved leadership, critical thinking, and decision-making abilities through pre/post evaluations.\r\n2.	250 youth acquire practical, job-relevant skills leading to increased employment and entrepreneurship potential.\r\n3.	100 youth benefit from exposure visits and report broader perspectives on community engagement and career options.\r\n4.	40 selected youth complete TOT programs and conduct at least one local training session each within 6 months post-training.\r\n5.	At least 60 youth initiate small-scale social change or civic projects in their villages/wards within the project period.','2026-01-06 15:48:04','2026-01-06 15:48:04'),(938,'DP-0013-OBJ-03-RES-01','DP-0013-OBJ-03','Results / Outcome:\r\n1.	800 youth (at least 50% girls) actively participated in structured awareness and life skills sessions.\r\n2.	At least 70% of participants show improved knowledge and positive attitudes toward gender equality, health, and environmental responsibility.\r\n3.	200 youth formed peer support groups or eco/climate clubs and conducted awareness drives in their communities.\r\n4.	Youth-led campaigns on menstrual health, substance abuse, climate action, and child rights were conducted in at least 40 villages/wards.\r\n5.	Documented behavioral changes such as better hygiene, responsible relationships, and greater civic participation reported among 60% of youth.','2026-01-06 15:48:38','2026-01-06 15:48:38'),(939,'DP-0013-OBJ-04-RES-01','DP-0013-OBJ-04','1.	At least 80% of the 20 youth show measurable improvement in school performance (10–20% increase in scores) within one academic year.\r\n2.	All 20 youth attend a minimum of 90% of the academic support sessions and complete structured learning modules.\r\n3.	Minimum 15 youth demonstrate improved self-confidence, digital literacy, and motivation for higher education through mentorship and career guidance.','2026-01-06 15:49:04','2026-01-06 15:49:04'),(940,'DP-0024-OBJ-01-RES-01','DP-0024-OBJ-01','Enhanced capacity for 400 single women to engage in entrepreneurship, leading to the creation and sustenance of successful businesses.','2026-01-07 09:40:49','2026-01-07 09:40:49'),(941,'DP-0024-OBJ-01-RES-02','DP-0024-OBJ-01','200 women have increased access to and participation in alternative livelihood programs, resulting in a diversified income base.','2026-01-07 09:40:49','2026-01-07 09:40:49'),(942,'DP-0024-OBJ-01-RES-03','DP-0024-OBJ-01','- Reduction in financial dependency of 320 as women gain economic autonomy and the skills to manage and grow their income streams.','2026-01-07 09:40:49','2026-01-07 09:40:49'),(943,'DP-0024-OBJ-01-RES-04','DP-0024-OBJ-01','Increased growth in individual earnings among 300 single women, contributing to their financial stability and empowerment.','2026-01-07 09:40:49','2026-01-07 09:40:49'),(944,'DP-0024-OBJ-02-RES-01','DP-0024-OBJ-02','Increased knowledge and availed legal rights among   single women, leading to a greater capacity to resist exploitation and discrimination.','2026-01-07 09:40:49','2026-01-07 09:40:49'),(945,'DP-0024-OBJ-02-RES-02','DP-0024-OBJ-02','Reduction in incidents of social stigma and cultural discrimination as measured by community feedback and reported experiences.','2026-01-07 09:40:49','2026-01-07 09:40:49'),(946,'DP-0024-OBJ-02-RES-03','DP-0024-OBJ-02','350 single women have enhanced feelings of self-worth and societal inclusion, with their active participation in community events and decision-making forums.','2026-01-07 09:40:49','2026-01-07 09:40:49'),(947,'DP-0024-OBJ-02-RES-04','DP-0024-OBJ-02','A measurable increase in respect for single women within their communities, reflected in changes in local customs and attitudes.','2026-01-07 09:40:49','2026-01-07 09:40:49'),(948,'DP-0024-OBJ-03-RES-01','DP-0024-OBJ-03','40 Empowered single women taking on visible leadership roles within their communities, contributing to local decision-making and advocacy efforts.','2026-01-07 09:40:49','2026-01-07 09:40:49'),(949,'DP-0024-OBJ-03-RES-02','DP-0024-OBJ-03','Improved self-efficacy among 20 single women in each area, as evidenced by their active engagement in community projects and initiatives.','2026-01-07 09:40:49','2026-01-07 09:40:49'),(950,'DP-0024-OBJ-03-RES-03','DP-0024-OBJ-03','An increase in the number of community-driven changes initiated by single women, indicating a shift in traditional power dynamics and gender roles.','2026-01-07 09:40:49','2026-01-07 09:40:49'),(951,'DP-0024-OBJ-03-RES-04','DP-0024-OBJ-03','The establishment of 12 supportive network that encourages and sustains the leadership development of single women','2026-01-07 09:40:49','2026-01-07 09:40:49'),(952,'DP-0024-OBJ-04-RES-01','DP-0024-OBJ-04','Enhanced engagement with government schemes and legal systems, leading to better access to resources and justice for single women.','2026-01-07 09:40:49','2026-01-07 09:40:49'),(953,'DP-0024-OBJ-04-RES-02','DP-0024-OB