INSERT INTO `project_risks` VALUES (9,'DP-0001-OBJ-01-RISK-01','DP-0001-OBJ-01','Despite awareness, children, especially girls, may still face barriers such as early marriage, household responsibilities, or financial difficulties, leading to school dropouts.','2025-11-25 12:35:59','2025-11-25 12:35:59'),(10,'DP-0001-OBJ-01-RISK-02','DP-0001-OBJ-01','Deep-rooted cultural norms and societal expectations, particularly regarding gender roles, may obstruct progress towards girls’ education and gender equality.','2025-11-25 12:35:59','2025-11-25 12:35:59'),(11,'DP-0001-OBJ-02-RISK-01','DP-0001-OBJ-02','Despite awareness and health camps, women and villagers may still struggle to access ongoing medical care due to distance, cost, or lack of facilities.','2025-11-25 12:35:59','2025-11-25 12:35:59'),(12,'DP-0001-OBJ-02-RISK-02','DP-0001-OBJ-02','The provided support may not be sufficient for long-term well-being, leading to continued struggles with healthcare.','2025-11-25 12:35:59','2025-11-25 12:35:59'),(13,'DP-0001-OBJ-03-RISK-01','DP-0001-OBJ-03','Self-employed individuals may face financial difficulties, market competition, or lack of business management skills','2025-11-25 12:35:59','2025-11-25 12:35:59'),(14,'DP-0003-OBJ-01-RISK-01','DP-0003-OBJ-01','Irregular attendance of students may lead to inconsistent learning.','2025-11-25 12:37:37','2025-11-25 12:37:37'),(15,'DP-0003-OBJ-02-RISK-01','DP-0003-OBJ-02','Without continuous guidance and motivation, Children’s Parliaments may struggle to remain active over time.\r\nSome children may dominate discussions, leaving others unheard or disengaged.','2025-11-25 12:37:37','2025-11-25 12:37:37'),(16,'DP-0003-OBJ-03-RISK-01','DP-0003-OBJ-03','Resistance to change, especially regarding gender roles, discipline, or educational priorities.\r\nSome families may be hesitant or unwilling to share personal issues.','2025-11-25 12:37:37','2025-11-25 12:37:37'),(23,'DP-0002-OBJ-01-RISK-01','DP-0002-OBJ-01','Limited parental involvemen