INSERT INTO `project_sustainabilities` VALUES (1,'SUS-0001','DP-0001','The long-term sustainability of the project is ensured through active community engagement, skill development, and strategic partnerships. By empowering children, youth, and families to take ownership of initiatives, we create a foundation for lasting impact. Capacity-building efforts equip youth with leadership, entrepreneurial, and life skills, enabling them to sustain and expand project activities. Collaboration with local educational institutions and governance bodies strengthens the support system, ensuring continued opportunities and resources for future growth.','A systematic monitoring framework is implemented to track progress, ensure efficiency, and make data-driven improvements. Key performance indicators are assessed through monthly and quarterly reviews, analyzing attendance, skill development, and employment outcomes. Regular surveys, interviews, and stakeholder meetings provide real-time feedback for refining program strategies. An annual impact review consolidates findings through case studies and success stories, demonstrating progress and areas for enhancement.','A structured reporting mechanism is followed to maintain transparency, accountability, and continuous learning. Monthly, quarterly, and annual reports document activities, beneficiary outcomes, and overall impact. Internal assessments and stakeholder feedback sessions help refine implementation strategies. Reports incorporate qualitative and quantitative data, including testimonials, case studies, and statistical analysis, to present a comprehensive picture of progress and areas for further development.','The evaluation process employs a multi-tiered approach to measure effectiveness and long-term impact. Regular internal assessments progress against predefined objectives, with monthly and quarterly evaluations providing insights for immediate improvements. Direct interactions with beneficiaries help assess behavioral changes and skill adoption. Annual impact assessments analyze long-term benefits, using both qualitative narratives and quantitative metrics to demonstrate transformational change resulting from the project’s implementation.','2025-11-25 11:45:34','2025-11-25 12:35:59'),(2,'SUS-0002','CIC-0001','The sustainability of the project depends on the quality and long-term impact of our work, as well as the support and contributions we receive from key stakeholders. \r\n1. Strong Community Involvement:\r\n2. Continuous Monitoring and Evaluation\r\n3. Outcome-Oriented Implementation\r\n4. Partnerships and Local Contributions:','The project executor closely monitors the project and carries out activities in line with the defined objectives. A report is submitted every month to the Project Monitoring Committee for review and assessment. The committee carefully evaluates the implementation and outcomes of the project. After the review, they prepare a comprehensive report summarizing key findings and developments. This report is then submitted to the General Councilor, ensuring continuous monitoring and offering valuable insights for further evaluation and guidance.','The progress of the project is presented every monthly, quarterly and yearly through the written reports of each activity carried out and the progress seen.methodology of reporting in a project refers to the structured approach used to collect, analyse, document, and communicate information about project progress, status, and outcomes to stakeholders','The evaluation methodology in a Women and Children at Risk project depends on the project’s goals, the type of interventions, the vulnerability of the beneficiaries, available data and resources, the monitoring framework, and donor or stakeholder expectations.','2025-11-25 11:53:59','2025-11-25 22:09:59'),(3,'SUS-0003','DP-0002','The sustainability of the project lies in fostering community ownership by involving local stakeholders in decision-making and implementation. Establishing children\'s clubs and peer-led groups will empower rural children to sustain healthy living practices, environmental responsibility, and gender equality. Collaborating with government bodies and child welfare organizations strengthens child protection mechanisms and policy advocacy. Regular monitoring and community feedback loops will track progress, assess impact, and refine strategies. By building local capacity and fostering long-term behavioral change, the project will continue to improve the physical and psychological well-being of rural childr','The monitoring process of the project will involve regular tracking of activities, participation, and immediate outcomes. Regular surveys and questionnaires will assess changes in children\'s knowledge, attitudes, and practices. Environmental activities like waste management and plantation drives will be monitored through progress reports and photographic documentation. Child protection efforts will be tracked by recording the number of awareness sessions, peer-support meetings, and reported cases addressed. This continuous monitoring process will ensure real-time tracking and timely adjustments for effective project implementation.\r\nThe project monitoring committee receives and reviews the implementation report every month. This helps track progress and ensure the project stays on course. Additionally, the committee conducts physical supervision once every four months','The In-charge of the project receives a report from the coordinator on a weekly basis to stay updated on the project\'s progress and challenges. Once a month, the In-charge compiles and submits a detailed report to the project monitoring committee for review and assessment. The committee carefully evaluates the implementation and outcomes of the project. After their review, they prepare a comprehensive report summarizing key findings and developments. This report is then submitted to the General Councilor, ensuring continuous monitoring and providing insights for further evaluation and guidance','The Project Is Evaluated Once In Six Months By The Evaluation Team Of The Province. The Team Provides Feedback To The Project In-Charge For Further Improvement And Better Implementation. At the end of the project, a thorough evaluation is conducted with structures format to assess its overall','2025-11-25 12:31:31','2025-11-25 12:31:31'),(4,'SUS-0004','DP-0003',NULL,NULL,NULL,NULL,'2025-11-25 12:37:37','2025-11-25 12:37:37'),(5,'SUS-0005','DP-0004','10 villages are empowered to develop their own villages and are trained to tackle the problems collectively','Monitoring the progress of the project will be participatory – taking the outputs, outcomes and ongoing challenges will be done by the project team along with beneficiaries','Field visits, interactions random evaluation on the impact with the prescribed format','Monthly progress reports and quarterly reports will be submitted to the provincial councilor and Mission coordinators. At the end of every year evaluation is done with the prescribed format.','2025-11-25 12:57:29','2025-11-25 12:57:29'),(6,'SUS-0006','DP-0005','The project ensures sustainability by fostering self-reliance through life skills, self-defense, and personal well-being, education, empowering girls beyond the project duration. Engaging parents strengthens supportive home environments, while partnerships with local NGOs and government bodies ensure continued resource access. Training local facilitators and volunteers builds community capacity for ongoing knowledge transfer. Peer mentorship and creative expression groups will promote continuous engagement and personal growth. By focusing on awareness, behavioral change, and community involvement, the project creates long-lasting impact, empowering girls to become resilient leaders and agents of change.','The project will use a structured monitoring process, including feedback forms after each session to assess participant experiences and gather suggestions. Local volunteers, staff, and facilitators will conduct community-based observations to track engagement and progress. Attendance logs and participation registers will ensure consistent tracking, while success stories and testimonials will be documented to capture qualitative impact. Regular review meetings with staff and stakeholders will help assess outcomes, address challenges, and refine strategies, ensuring the project remains aligned with its objectives.','The day-to-day report of the project will be submitted to the project in charge by the animators. The project in-charge will oversee the reporting process, ensuring regular and accurate documentation. Monthly progress reports will be compiled, detailing activities conducted, participation levels, key outcomes, and challenges faced. These reports will be sent to the Project Monitoring Committee after which the committee scrutinizes and provides feedback to the General Project Managing Committee','The project will utilize both quantitative and qualitative evaluation methods to assess its effectiveness and impact. Pre- and post-assessment surveys will measure changes in participants\' knowledge, attitudes, and skills. Regular feedback will be gathered through interviews, focus group discussions, and observation reports from facilitators and community volunteers. \r\nOnce in 6 months the Project Monitoring Committee at province level assesses the implementation of the project and the same is documented. At the end of project implementation, a thorough evaluation is taken to assess the impact.','2025-11-25 13:09:34','2025-11-25 13:09:34'),(7,'SUS-0007','DP-0006','To ensure the sustainability of our youth empowerment project in Jaggayyapeta, we have developed a strategic approach centered on community participation, capacity building, and institutional collaboration. By actively involving children, youth, families, educational institutions and community leaders in decision-making, we foster ownership and long-term commitment. Capacity-building initiatives equip youth leaders with essential skills to sustain and expand project activities, ensuring continued impact. Integration with local institutions, including educational centers, strengthens support systems and provides lasting opportunities.','Our youth empowerment project follows a structured monitoring process to ensure effectiveness, track progress, and make necessary improvements. Monthly and Quarterly reviews assess the key benchmarks in all the areas, supported by attendance records, skill assessments, and employment data. Regular feedback through surveys and focus groups helps capture insights from participants and stakeholders, allowing for timely adjustments to our programs. An annual evaluation measures overall impact, using success stories and case studies to showcase transformative change.','Our youth empowerment project follows a clear and transparent reporting system to track progress, ensure accountability, and make continuous improvements. We prepare monthly, quarterly, and annual reports to measure outcomes, assess impact, and refine our approach. Regular internal evaluations help us make timely adjustments and impact. Beneficiary feedback is key to shaping our activities to meet youth needs effectively.','Our evaluation framework includes monthly, quarterly, and annual assessments, internal evaluation to measure effectiveness and impact. Internal evaluations focus on continuous monitoring of activities against objectives, ensuring timely improvements based on real-time data and participant feedback, direct beneficiary interactions to assess on-ground progress and long-term outcomes. This structured approach captures both measurable achievements and transformative changes happen due to the implementation of the project.','2025-11-25 13:15:47','2025-12-15 12:07:56'),(8,'SUS-0008','DP-0007','Building strong partnerships with other organizations, government agencies, and the local community is vital for the destitute home\'s sustainability. Engaging community members as volunteers and donors ensures ongoing support. Collaborating, sharing resources, and coordinating services help sustain the project\'s impact.','The project\'s monitoring process begins with collaborative planning led by the project in-charge, alongside the project executor and supportive staff. This collaborative effort ensures activities are meticulously aligned with project objectives. The provincial councillor in-charge of Social Apostolate conducting regular visits to ensure adherence to plans and standards. These visits serve as opportunities for direct observation, allowing for the identification of challenges and provision of guidance as needed. Moreover, ongoing communication and collaboration among stakeholders foster a culture of continuous improvement, driving the project towards sustained success','The reporting process follows a structured methodology to ensure effective communication and accountability. Each month, the project executor submits a detailed report to the project in-charge, who then consolidates and shares it with the councillor in-charge of Social Apostolate. Additionally, monthly reports are transmitted to both Swiss and Indian project coordinators to provide comprehensive updates on project activities and developments.\r\nFurthermore, a more comprehensive progress report is compiled and shared on a quarterly basis with the Mission Coordinators in both India and Switzerland. This detailed report offers a comprehensive overview of project achievements, challenges, and future plans, enabling stakeholders to assess progress and provide support as necessary.','Evaluating a destitute home involves setting clear objectives to assess care quality, support services effectiveness, and resident well-being. Establishing evaluation criteria covers factors like facility, cleanliness, amenities availability, and service accessibility. We assess if the home meets standards and if residents are content to see what needs improvement. Together, we collaborate to enhance conditions and monitor progress to ensure lasting changes','2025-12-04 14:51:33','2025-12-04 14:51:33'),(9,'SUS-0009','DP-0008','The sustainability of the legal empowerment initiative is rooted in the progressive transformation of communities through awareness, capacity-building, and systemic access to justice. As women and youth gain knowledge of their legal rights, they are empowered to assert these rights and participate actively in decision-making processes within their families and communities.\r\nThe Pratyasha team plays a crucial role  by facilitating the amicable resolution of family and community disputes. The project ensures that marginalized and economically disadvantaged groups will have access to justice and support This evolving legal consciousness and the community\'s ability to independently address legal and social challenges contribute to the long-term sustainability and impact of the project.',NULL,'The project will be systematically monitored to ensure its effectiveness, relevance, and long-term impact. The Project Executor will lead the monitoring process, supported by a participatory approach that involves all stakeholders. Key components of the monitoring strategy include:','Regular assessments involving the Project Executor, women leaders, youth representatives to review progress, challenges, and outcomes.','2025-12-07 11:58:50','2025-12-07 11:58:50'),(10,'SUS-0010','DP-0009','Sustainability of the Project:\r\nThe sustainability of this project lies in its built-in systems, community ownership, and capacity enhancement of the staff. By establishing a standardized and practical monitoring and accountability framework, the project ensures long-term consistency in financial management and program transparency across all Social Apostolate Centers.','Key sustainability measures include:\r\n1.	Institutionalization of Monitoring Practices: The integration of regular inter-center monitoring and documentation into the routine operations ensures continued oversight even after the project period ends.\r\n2.	Capacity Building of Staff: Continuous training and capacity-building initiatives will empower staff with the necessary financial and monitoring skills, reducing dependence on external expertise and ensuring the internal management remains strong.\r\n3.	Core Committee for Accountability: The creation of a core monitoring committee, comprising the Sister in charge, accountant, and senior staff, provides dedicated leadership and accountability for ongoing implementation.\r\n4.	Use of Standardized Tools: The development and adoption of user-friendly tools, formats, and manuals will allow for uniform implementation and easy transfer of knowledge to new staff.\r\n5.	Community Participation and Ownership: Involving women’s groups and local beneficiaries in transparency initiatives fosters trust and shared responsibility, helping prevent malpractices and enhancing the credibility of each center.\r\n6.	Resource Center Support: The central Resource Center will serve as a long-term hub for training, review, and mentoring, ensuring ongoing support and quality control for all centers.\r\nThrough these strategic measures, the project will not only strengthen the existing systems but also create a culture of accountability and transparency that can be sustained well beyond the initial implementation phase.','A baseline assessment will establish the initial status of financial management and staff capacity. Quarterly monitoring visits by the core committee (Sister in charge, accountant, and senior staff) will ensure timely review using standardized tools. A mid-term review at six months will measure progress and guide improvements. An end-line evaluation after 12 months will assess outcomes in transparency, documentation quality, and accountability. Tools such as checklists, visit reports, training assessments, and feedback from staff and beneficiaries will provide measurable evidence for analysis and future planning','reporting, evaluation and appraisal form the beneficiaries','2025-12-08 11:41:52','2025-12-08 11:41:52'),(11,'SUS-0011','DP-0010','1.	Community Ownership: Parents, teachers, and community leaders will be actively involved in planning and monitoring, ensuring shared responsibility and long-term commitment.\r\n2.	Capacity Building: Teachers will be trained in remedial strategies and motivational methods, enabling them to continue supporting students even after the project period.\r\n3.	Parental Engagement: Regular workshops and meetings will strengthen parents’ role as motivators and role models, ensuring ongoing support for children’s education.\r\n4.	Student Empowerment: By developing study habits, confidence, and life skills, students will continue to benefit beyond the duration of the program.\r\n5.	Recognition and Motivation: Initiatives such as the Best Teacher Award and recognition of student achievements will encourage ongoing dedication.','Effective monitoring ensures that all activities are carried out as planned, results are measured accurately, and timely improvements are made. The project will follow a continuous and structured monitoring process involving students, teachers, parents, and project staff.','The reporting methodology ensures that project progress, achievements, challenges, and outcomes are documented in a systematic, timely, and transparent manner. The process involves collecting data from all activity levels, analyzing it, and presenting it in structured reports for decision-making and accountability.','The project will be evaluated using both quantitative and qualitative methods to ensure accountability and continuous improvement. Baseline and endline assessments will measure academic and life-skill growth, while monthly monitoring will track attendance, participation, and progress. Teacher performance and remedial strategies will be periodically reviewed, with recognition through the Best Teacher Award. Parent feedback will be gathered on children’s discipline and motivation, supported by academic records, test scores, and case studies. Mid-term and final review meetings with stakeholders will guide improvements, and if feasible, an external expert will validate outcomes and recommend future scaling.','2025-12-08 13:59:43','2025-12-08 13:59:43'),(12,'SUS-0012','DP-0011',NULL,NULL,NULL,NULL,'2025-12-11 09:47:21','2025-12-11 09:47:21'),(13,'SUS-0013','DP-0012','Sustainability of the Project: \r\n	Regular capacity building ensures farmers retain skills and apply organic methods independently.\r\n	Strong local groups encourage peer learning, collective action, and long-term motivation.\r\n	Steady income from organic products makes farming economically sustainable.\r\n	Financial support helps farmers invest and sustain organic practices.\r\n	Restored natural fertility and reduced chemical dependency make farming ecologically sustainable.','Financial support helps farmers invest and sustain organic practices.\r\n	Restored natural fertility and reduced chemical dependency make farming ecologically sustainable.','Methodology of Evaluation\r\nThe evaluation of the organic farming project will be conducted through a combination of baseline and endline surveys to measure changes in farming practices, income, and soil health. Regular field visits and monitoring reports will track the progress of activities, while feedback from farmers through focus group discussions will provide qualitative insights. Key indicators such as the number of farmers trained, those practicing organic methods, and market participation will be monitored. An external evaluation at the end of the project will assess overall impact, sustainability, and the level of community ownership.','interview, success stories, oral and written evealuation','2025-12-11 14:11:07','2025-12-11 14:11:07'),(14,'SUS-0014','DP-0013','By the end of 24 months, at least 40 trained youth leaders (including TOT graduates) will independently manage and sustain 40 functional Youth Parliaments and initiate ongoing community development activities in 30 villages/wards. These will be supported through established partnerships with local government bodies, NGOs, schools, and skill training institutions. Youth groups will mobilize local resources, maintain digital documentation, and conduct quarterly review meetings to ensure long-term continuity, ownership, and reduced dependency on external funding.','Evaluation, reporting, field visit','monthly reports,','Methodology of Evaluation\r\nThe project will follow a three-phase evaluation approach: a baseline assessment in Month 1, a mid-term review at Month 12, and a final evaluation at Month 24. Evaluation tools will include structured surveys, focus group discussions, interviews, and case studies, with measurable indicators for leadership, skill development, employment, and civic engagement. At least 80% of participants will be covered in each round, with findings disaggregated by gender and district. Results will be documented, shared with stakeholders, and used to adjust strategies for improved impact and sustainability.','2025-12-11 14:57:26','2025-12-12 17:27:22'),(15,'SUS-0015','DP-0014','EDIT Explain the Sustainability of the ProjExplain the Sustainability of the ProjExplain the Sustainability of the ProjExplain the Sustainability of the ProjExplain the Sustainability of the ProjExplain the Sustainability of the Proj','again EDIT Explain the Monitoring Process of the Project:\r\nExplain the Monitoring Process of the Project:\r\nExplain the Monitoring Process of the Project:\r\nExplain the Monitoring Process of the Project:\r\nExplain the Monitoring Process of the Project:\r\nExplain the Monitoring Process of the Project:','again EDIT Explain the Methodology of Reporting:Explain the Methodology of Reporting:Explain the Methodology of Reporting:Explain the Methodology of Reporting:Explain the Methodology of Reporting:Explain the Methodology of Reporting:Explain the Methodology of Reporting:Explain the Methodology of Reporting:Explain the Methodology of Reporting:','again EDIT Explain the Methodology of Evaluation:Explain the Methodology of Evaluation:Explain the Methodology of Evaluation:Explain the Methodology of Evaluation:Explain the Methodology of Evaluation:Explain the Methodology of Evaluation:Explain the Methodology of Evaluation:Explain the Methodology of Evaluation:Explain the Methodology of Evaluation:Explain the Methodology of Evaluation:Explain the Methodology of Evaluation:Explain the Methodology of Evaluation:','2025-12-11 17:41:05','2025-12-12 09:08:04'),(16,'SUS-0016','DP-0015','Edited Explain the Sustainability of the ProjExplain the Sustainability of the ProjExplain the Sustainability of the ProjExplain the Sustainability of the ProjExplain the Sustainability of the ProjExplain the Sustainability of the Proj','Edited Explain the Monitoring Process of the Project:\r\nExplain the Monitoring Process of the Project:\r\nExplain the Monitoring Process of the Project:\r\nExplain the Monitoring Process of the Project:\r\nExplain the Monitoring Process of the Project:\r\nExplain the Monitoring Process of the Project:','Edited Explain the Methodology of Reporting:Explain the Methodology of Reporting:Explain the Methodology of Reporting:Explain the Methodology of Reporting:Explain the Methodology of Reporting:Explain the Methodology of Reporting:Explain the Methodology of Reporting:Explain the Methodology of Reporting:Explain the Methodology of Reporting:','Edited Explain the Methodology of Evaluation:Explain the Methodology of Evaluation:Explain the Methodology of Evaluation:Explain the Methodology of Evaluation:Explain the Methodology of Evaluation:Explain the Methodology of Evaluation:Explain the Methodology of Evaluation:Explain the Methodology of Evaluation:Explain the Methodology of Evaluation:Explain the Methodology of Evaluation:Explain the Methodology of Evaluation:Explain the Methodology of Evaluation:','2025-12-11 17:43:17','2025-12-12 14:13:03'),(17,'SUS-0017','DP-0016','The sustainability of the project will largely depend on its ability to create long-term, self-sustaining mechanisms within the community. Over the next three years, the following factors will contribute to the continued success and impact of the project:\r\n1.	Community Ownership: As Indigeneous women gain more skills and confidence, it is expected that they will take ownership of the initiatives started by the project. \r\n2.	Local Leadership: The cultivation of strong local leaders from within the community ensures that the initiatives have a long-lasting impact. Training women in leadership roles will empower them to continue driving socio-economic change within their communities, even after the project\'s formal support has ended.\r\n3.	Institutional Partnerships: By fostering partnerships with local governments, NGOs, and other institutions, the project will create a network of support that can continue to provide resources and guidance to sustain ongoing programs. This can include leveraging government schemes or other community-driven initiatives that support women\'s empowerment.\r\n4.	Economic Diversification: Encouraging women to explore a wide range of income-generating activities, from agricultural improvements to micro-enterprises, will help ensure that the women have diverse income streams, making them less reliant on a single source and more adaptable to changing economic conditions.\r\n5.	Skill Enhancement and Education: The emphasis on lifelong learning and upskilling will ensure that women remain competitive in the workforce and have the capacity to continue pursuing educational and professional development opportunities. This continuous capacity building is critical for maintaining socio-economic mobility in the long term.\r\n6.	Social and Cultural Integration: Acknowledging the socio-cultural dynamics and integrating the project within the Indigeneous community’s traditional frameworks ensures that the changes implemented are accepted and supported by the wider community. This ensures sustainability by making the empowerment of women an accepted part of the community culture.\r\nThus the project aims at a significant difference in the lives of Indigeneous women in Beed District, its long-term sustainability will depend on strengthening community structures, creating self-reliance, and fostering local leadership. If these elements are successfully cultivated, the impact of the project will continue to grow, leading to empowered and resilient Indigeneous women who contribute to the economic and social development of their communities long into the future.','Sr. Annie Joseph will be in charge of the project and undertake its implementation with project staff. For effective implementation, the project plans to collaborate wherever possible with NGOs and the government departments. The mode of implementation is on daily and weekly basis will be carried out by the Project Co-ordinator. The outputs and outcomes will be captured through a participatory process with beneficiaries and progress reports will be sent to the Province and Mission Coordinator as per the norms. \r\nOnce in 3 month visit to the project village by the centre in charge\r\nMonitoring of weekly activities by the field Coordinator\r\nMonthly review, Planning and evaluation by the centre in charge','20 days visit and daily reporting through Watsapp by the animators to Field Coordinator\r\nTwice a month visit to all villages by the co-ordinator and reporting to Sister in charge\r\nHalf yearly reporting to Provincial Councillor and General Councillor	\r\nAnnual reporting to Generalate by the centre in charge','Evaluation to be carried out after 6 months and after 1 year with the availed results, feed back from Stakeholders and staff','2025-12-11 19:12:54','2025-12-12 15:14:31'),(18,'SUS-0018','DP-0017','The staff of the Resource Centre takes the initiative in planning various activities and programs. Once the initial plans are drafted, they consult with the sisters in the centre to gather their insights and suggestions. This collaborative approach ensures that the programs align with the centre’s objectives and serve the intended purpose effectively. The sisters\' input enhances the quality and impact of the initiatives, making them more relevant and meaningful.','The monitoring of the Resource Centre is conducted systematically to ensure its effectiveness. Every month, the RC team reviews the progress of activities, assessing their impact and identifying areas for improvement. Once every four months, the Sisters and staff of the apostolate participate in a more in-depth evaluation, providing additional insights and recommendations. When training programs are offered to outsiders, their feedback is gathered to understand the program’s effectiveness and relevance. This structured monitoring process helps in making necessary adjustments and ensuring continuous growth and improvement.','The Resource Centre prepares a detailed report on the implementation of its activities and the outcomes achieved. This report highlights the progress, challenges faced, and the impact of various programs. It is then submitted to the General Councilor in charge of the Social Apostolate for review and guidance. This reporting process ensures accountability, transparency, and continuous growth in the centre’s mission.','The evaluation of the Resource Centre is conducted every six months by the team, with guidance from an external expert online. For the first two years, the team carries out the evaluation independently, analysing progress and making necessary improvements. In the third year, an external expert takes full responsibility for the evaluation, providing an objective assessment of the centre’s performance. This approach ensures a balance between internal reflection and external insights for continuous development. The structured evaluation process helps in maintaining quality and achieving the centre’s goals effectively.','2025-12-13 09:39:33','2025-12-13 09:39:33'),(19,'SUS-0019','DP-0018',NULL,NULL,NULL,NULL,'2025-12-14 19:56:54','2025-12-14 19:56:54'),(20,'SUS-0020','DP-0019','dasdas','dadad','dasdas','dasdas','2025-12-14 20:13:32','2025-12-14 20:13:32'),(21,'SUS-0021','DP-0020','The project ensures long-term sustainability by establishing suitable waste management measures and fostering community ownership. Training sanitation workers, engaging volunteers, and promoting household waste segregation will create lasting behavioral change. Strong collaboration with local authorities and alignment with Swachh Bharat Abhiyan- Gramin will ensure continued support. Regular awareness programs will reinforce responsible waste disposal, maintaining a clean and healthy environment resulting in better health for the community members','The Monitoring Committee, comprising a panchayat representative, a St. Ann Society representative, and 25 volunteers (10 in Rajavaram, 15 in S.A. Peta), will oversee the project. Volunteers will conduct weekly community meetings for the first  weeks, followed by fortnight meetings for next two months, then one meeting per month thereafter. They will also inspect waste collection initially and gradually reduce frequency as the system stabilizes. The committee will review reports, address challenges, and ensure smooth implementation. Regular evaluations and corrective actions will maintain an effective and sustainable waste management system.','The Project Incharge will compile reports from volunteers on community meetings, waste collection, and segregation monitoring, highlighting progress, challenges, and feedback. These reports will be reviewed and presented to the Project Monitoring Committee in monthly meetings for assessment and guidance. Key actions and improvements will be documented to ensure accountability, transparency, and effective implementation.','The Project Monitoring Committee will do evaluations to measure impact and effectiveness. Volunteers will track household participation, waste collection, and segregation, while the Project Incharge compiles findings for review. Quarterly evaluations will assess progress, address challenges, and guide improvements. A mid-term review will evaluate intervention effectiveness, and a final evaluation will measure long-term impact and sustainability, ensuring continuous improvement and accountability.','2025-12-14 21:01:36','2025-12-14 21:01:36'),(22,'SUS-0022','DP-0021','The project is designed to be sustainable by strengthening capacities, systems, and community ownership. Awareness on health, education, and financial literacy equips households—especially women and youth—with knowledge that continues beyond the project period. Facilitating access to government schemes enables families to independently claim entitlements in the long term. Livelihood sustainability is strengthened through income diversification, value addition, and reduced dependence on environmentally harmful practices. Farmer groups and the Farmer Producer Organisation (FPO) are built through participatory processes to function as community-managed institutions capable of sustaining collective income and market engagement after project support ends.','Monitoring will be continuous and participatory. Project staff will conduct regular field visits to track activities, participation, and progress against objectives. Monthly internal reviews will assess implementation, challenges, and corrective actions. Monitoring tools such as attendance registers, activity reports, household follow-up records, and scheme tracking sheets will ensure systematic documentation, while community feedback meetings will support learning and accountability.','Field staff will prepare monthly activity reports, which will be consolidated into quarterly narrative reports highlighting progress, outcomes, challenges, and learnings. Reports will be supported by photographic documentation, brief case stories, and beneficiary reflections to provide qualitative evidence of change.','Evaluation will include annual internal reviews and participatory discussions with farmers, women, and youth to assess changes in awareness, livelihoods, collective functioning, and access to services. An end-of-project evaluation will assess overall impact, sustainability of farmer collectives and the FPO, and inform future programming.','2025-12-15 16:09:36','2025-12-15 17:07:15'),(23,'SUS-0023','DP-0022','Five villages will have access to water and the villagers themselves will be responsible for its maintenance and care. The children will have good foundation for their studies and would not drop out of the schools. These measures ensure that both the water resource initiatives and the coaching centers become self-sustaining parts of their communities over the long term','In the five villages Area Monitoring team of elders comprising both men and women would be set up to monitor the project. The staff and the sisters will regularly monitor the progress and implement the project in an effective way.','Reporting every month regularly.','1.	Baseline and Endline Surveys:\r\nCollect data before and after the implementation to measure changes in water access, children’s learning levels, and community well-being.\r\n2.	Mid-Term and Final Evaluation:\r\nConduct evaluations at the midpoint and end of the project to assess progress toward objectives.\r\n3.	Monthly Progress Reviews:\r\nRegular internal reviews by the project team to monitor implementation, identify challenges, and document progress.\r\n4.	Community Feedback:\r\nGather feedback from community members, parents and children.\r\n5.	On-site Observation:\r\nField visits to check the functioning of borewells, water availability, and effectiveness of coaching centers.\r\n6.	Case Studies and Success Stories:\r\nDocument real-life impact through stories of change and testimonials from beneficiaries.','2025-12-19 21:48:24','2025-12-19 21:48:24'),(24,'SUS-0024','IOGEP-0001',NULL,NULL,NULL,NULL,'2025-12-22 16:01:04','2025-12-22 16:01:04'),(25,'SUS-0025','IOGEP-0002',NULL,NULL,NULL,NULL,'2025-12-24 21:18:30','2025-12-24 21:18:30'),(26,'SUS-0026','IOGEP-0003','For the sustainability there will be regular youths meeting in the village. During the meeting the identification of the challenges and issues of the youth will be enumerated. Discussions will be held on means to overcame the same. It will help the youth to continuous participation in the meeting and over all development activities. Thus, all the youth of the villages will inspire to contribute equal efforts for the overall development of the villages. By taking responsibility to solve their own problem the youth will learn to take on challenges of life they face. The project in turn will enable the youth to help themselves by which the project will be sustained to a great extent.','Same as above','Monthly activity report, and Quarterly  progress report and Annual report','As above','2025-12-27 09:04:25','2025-12-27 10:42:50'),(27,'SUS-0027','DP-0023','Learning became very joyful and interesting to children and all are happy to come\r\nThey are developing various skills and talents and are very happy with the given opportunities.\r\nThey are developing skills for drawing,speech ,writing,reading and all extra curricular activities.\r\nthe youth come forward in the development activities of the village.','Daily reporting by the teachers\r\nWeekly visit by staff\r\nMonthly evaluation and reporting','Annual reporting','Evaluation by center in charge\r\nEvaluation by project monitoring committee','2025-12-29 12:34:38','2025-12-29 12:34:38'),(28,'SUS-0028','IOGEP-0004',NULL,NULL,NULL,NULL,'2025-12-30 09:46:21','2025-12-30 09:46:21'),(29,'SUS-0029','DP-0024','To ensure the sustainability of our project aimed at empowering single women, we\'ve crafted a comprehensive strategy that incorporates community engagement, capacity building, and institutional integration, by actively involving community members in the planning and decision-making process, we foster a sense of ownership and align the project\'s goals with the community\'s aspirations.','Our monitoring strategy encompasses quarterly reviews to assess progress against benchmarks for skill development, employment, and entrepreneurship, underpinned by detailed attendance records, skill assessment reports, and employment data. Regular feedback mechanisms, including surveys and focus groups, will allow us to capture insights from participants and stakeholders, facilitating real-time adjustments to our interventions. Annually, we will evaluate our outcomes in relation to our overarching objectives, utilizing success stories and case studies to highlight the project\'s transformative impact.','Our project\'s reporting methodology is meticulously designed to ensure thorough accountability and insight into our efforts to empower single women in targeted areas. Incorporating both regular reporting cycles and evaluations, we implement monthly, quarterly, and annual reports to monitor immediate outputs, progress towards broader objectives, and the overall impact, respectively.','Our evaluation framework encompasses monthly, quarterly, and annual reports, complemented by both internal and external evaluations, to offer a comprehensive view of our project\'s effectiveness in empowering single women. Internal evaluations will focus on immediate and ongoing assessment of activities against our objectives, while external evaluations will provide an impartial perspective, including direct interactions with beneficiaries to witness on-ground progress firsthand.','2026-01-03 13:21:34','2026-01-03 15:12:43'),(30,'SUS-0030','DP-0025','Empowering Marginalized Communities for Holistic Well-being\" project is planned to keep helping the community even after it officially ends. We\'re making sure the community feels the project is theirs by getting them involved from the start. This way, they\'re more likely to keep it going. We\'re also teaching community leaders and people who benefit from the project important skills so they can manage things themselves in the future.','The monitoring component of the \"Empowering Marginalized Communities for Holistic Well-being\" project is geared towards ensuring that project activities align with our set objectives through ongoing data collection and analysis. By employing systematic methods like surveys and interviews, we\'re able to track the progress of activities, from gender equality workshops to health camps, monitoring participation rates and gauging shifts in community knowledge and attitudes.','For the \"Empowering Marginalized Communities for Holistic Well-being\" project, we have a clear plan on how to share updates and results with everyone involved. We\'ll send out regular updates every month and more detailed reports every three months to keep all our partners, community members, and supporters in the loop. Our reports will be based on real data from our project, including how many people are participating and what they\'re saying about their experiences.','The evaluation component of our project is dedicated to understanding the overall impact on targeted communities, assessing the effectiveness of interventions for achieving long-term sustainability. Through baseline and endline surveys, we measure changes in community well-being, economic status, and environmental sustainability to gauge the project\'s success.','2026-01-03 16:46:08','2026-01-03 16:46:08'),(31,'SUS-0031','DP-0026',NULL,NULL,NULL,NULL,'2026-01-10 11:08:17','2026-01-10 11:08:17');
