DROP TABLE IF EXISTS `projects`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `projects` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `project_id` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `user_id` bigint(20) unsigned NOT NULL,
  `project_type` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `project_title` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `society_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `president_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `in_charge` bigint(20) unsigned NOT NULL,
  `in_charge_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `in_charge_mobile` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `in_charge_email` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `executor_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `executor_mobile` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `executor_email` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `full_address` text COLLATE utf8mb4_unicode_ci,
  `overall_project_period` int(11) DEFAULT NULL,
  `current_phase` int(11) DEFAULT NULL,
  `commencement_month_year` date DEFAULT NULL,
  `overall_project_budget` decimal(10,2) NOT NULL DEFAULT '0.00',
  `amount_forwarded` decimal(10,2) DEFAULT NULL,
  `local_contribution` decimal(15,2) NOT NULL DEFAULT '0.00',
  `amount_sanctioned` decimal(10,2) DEFAULT NULL,
  `opening_balance` decimal(10,2) DEFAULT NULL,
  `coordinator_india_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `coordinator_india_phone` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `coordinator_india_email` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `coordinator_luzern_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `coordinator_luzern_phone` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `coordinator_luzern_email` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `status` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'underwriting',
  `completed_at` timestamp NULL DEFAULT NULL,
  `completion_notes` text COLLATE utf8mb4_unicode_ci,
  `goal` text COLLATE utf8mb4_unicode_ci,
  `predecessor_project_id` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `initial_information` text COLLATE utf8mb4_unicode_ci,
  `target_beneficiaries` text COLLATE utf8mb4_unicode_ci,
  `general_situation` text COLLATE utf8mb4_unicode_ci,
  `need_of_project` text COLLATE utf8mb4_unicode_ci,
  PRIMARY KEY (`id`),
  UNIQUE KEY `projects_project_id_unique` (`project_id`),
  KEY `projects_user_id_foreign` (`user_id`),
  KEY `projects_in_charge_foreign` (`in_charge`),
  KEY `projects_predecessor_project_id_foreign` (`predecessor_project_id`),
  CONSTRAINT `projects_in_charge_foreign` FOREIGN KEY (`in_charge`) REFERENCES `users` (`id`) ON DELETE CASCADE,
  CONSTRAINT `projects_predecessor_project_id_foreign` FOREIGN KEY (`predecessor_project_id`) REFERENCES `projects` (`project_id`) ON DELETE SET NULL,
  CONSTRAINT `projects_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=40 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

